import React, { Component } from 'react';
import Header from './Header';
import '../App.css';

class Homepage extends Component {
  render() {
    return (
      <div>
        <Header />
        <div className="homebackground">
          <p>
            สวัสดีครับ ผมชื่อเอก กำลังเรียนคณะวิศวกรรมศาสตร์
            สาขาการออกแบบและการผลิตยายนต์ เป็นภาคอินเตอร์นะครับ<br></br>
            ผมทำเว็บนี้ขึ้นมาเพื่อเก็บประวัติส่วนตัวของผม ผมไม่เคยทำมาก่อนเลย
            <br></br>
            ทั้งหมดนี้ถูกเขียนด้วย Java Script นะครับ
          </p>
        </div>
        <p>hi</p>
      </div>
    );
  }
}

export default Homepage;
